export const getNutritionInfo = async (foodName) => {
  try {
    console.log('Getting nutrition info for food:', foodName);
    const response = await api.get('/nutrition', {
      params: { food: foodName },
    });
    console.log('Nutrition response:', response.data);
    return response.data;
  } catch (error) {
    console.error('Error in getNutritionInfo:', error);
    throw error;
  }
};
